    //         (error) => {
    //             if (error.response.status === 401) {
    //                 setAuthHeader(null);
    //             } else {
    //                 this.setState({data: error.response.code})
    //             }

    //         }
    //     );
    // };


    P() {
        request(
            "GET",
            "/applications",
            {}).then(
            (response) => {
                this.setState({data2: response.json()})
            }).catch(
            (error) => {
                if (error.response.status === 401) {
                    setAuthHeader(null);
                } else {
                    this.setState({data2: error.response.code})
                }

            }
        );
    };

  render() {
    return (
        // <div className="row justify-content-md-center">
        //     <div className="col-4">
        //         <div className="card" style={{width: "18rem"}}>
        //             <div className="card-body">
